import App from '../App.vue'
import router from 'vue-router'
import Home from '../views/Home.vue'
// import Login from '../views/Login.vue'

App.use(router)

const routes = [
    {
        path:'/',
        name:'Home',
        component:Home //预加载
    },
    {
        path:'/login',
        name:'Login',
        component:() => import('../views/Login.vue') //懒加载
    }
]

export default routes
